import React from 'react'
import { Box, Typography } from '@mui/material'
const Create = () => {
  return (
    <div>
      <Box sx={{display:"flex",width:"120%",backgroundColor:"#0003f",marginBottom:"10px"}}>
        <Typography sx={{marginLeft:"20px"}}>

        </Typography>
      </Box>
    </div>
  )
}

export default Create
